import React from "react";
import Header from "./components/Header";
import EmployeeTable from "./components/EmployeeTable";
import Navbar from "./components/Navbar";
import Button from 'react-bootstrap/Button';
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
       <Navbar />
      <EmployeeTable />
    </div>
  );
}

export default App;
